 Para desarrollar un programa en ESP32 que muestre en la consola serial la dirección de los sensores de temperatura Dallas 18B20 y su temperatura correspondiente, puedes utilizar el firmware de Arduino para ESP32 y el driver para el sensor Dallas 18B20 que se proporciona en la página oficial del fabricante.

Primero, asegúrate de que tienes instalado el driver para el sensor Dallas 18B20 en tu IDE de Arduino. Si no lo tienes, puedes descargarlo desde el sitio web del fabricante o desde GitHub. Una vez que lo hayas instalado, puedes comenzar a desarrollar tu programa.

Aquí hay un ejemplo básico de cómo podrías estructurar tu código:

```cpp
#include <Wire.h>
#include <DallasTemperature.h>

#define SENSOR_COUNT 1 // Número de sensores Dallas 18B20 que deseas leer

DallasTemperature sensors(&Wire);

void setup() {
  Serial.begin(115200); // Inicia la serial para la comunicación con la consola
  Serial.println("Starting sensor reading...");

  sensors.begin();
  Serial.println("Sensor initialization complete.");
}

void loop() {
  sensors.requestTemperatures(); // Solicita las temperaturas de todos los sensores

  // Itera sobre cada sensor y muestra su dirección y temperatura
  for (int i = 0; i < SENSOR_COUNT; i++) {
    if (sensors.getAddress(i, &addr)) {
      Serial.print("Sensor found at address 0x");
      Serial.println(addr, HEX);
      float tempC = sensors.getTempC(addr);
      Serial.print("Temperature: ");
      Serial.print(tempC);
      Serial.println("°C");
    } else {
      Serial.println("No sensor found.");
    }
    delay(1000); // Espera 1 segundo antes de leer de nuevo
  }
}
```

Este código:
1. Incluye las bibliotecas necesarias para la comunicación I2C y para el sensor Dallas 18B20.
2. Define el número de sensores que deseas leer. En este ejemplo, solo se lee de un sensor, pero puedes cambiar `SENSOR_COUNT` para leer más.
3. Inicializa la comunicación I2C y el sensor.
4. Establece un bucle que lee las temperaturas de todos los sensores cada segundo.
5. Para cada sensor, verifica si el sensor está presente y, si lo está, muestra su dirección y la temperatura en grados Celsius.

Una vez que hayas escrito y probado tu código, puedes cargarlo en tu ESP32 y ver las direcciones de los sensores y sus temperaturas en la consola serial. Asegúrate de que los pines I2C del ESP32 estén configurados correctamente y que los sensores estén correctamente conectados al ESP32.

 Sure, here is a simple implementation of the bubble sort algorithm in C:

```c
#include <stdio.h>

void bubble_sort(int arr[], int n) {
    int i, j, temp;
    for (i = 0; i < n-1; i++) {
        for (j = 0; j < n-i-1; j++) {
            if (arr[j] > arr[j+1]) {
                // Swap arr[j] and arr[j+1]
                temp = arr[j];
                arr[j] = arr[j+1];
                arr[j+1] = temp;
            }
        }
    }
}

void print_array(int arr[], int n) {
    int i;
    for (i = 0; i < n; i++) {
        printf("%d ", arr[i]);
    }
    printf("\n");
}

int main() {
    int arr[] = {64, 34, 25, 12, 22, 11, 90};
    int n = sizeof(arr)/sizeof(arr[0]);
    bubble_sort(arr, n);
    printf("Sorted array: \n");
    print_array(arr, n);
    return 0;
}
```

In this code, the `bubble_sort` function sorts an array of integers in ascending order using the bubble sort algorithm. The `print_array` function is used to print the array elements. The `main` function initializes an array, sorts it using the `bubble_sort` function, and then prints the sorted array.

 La fórmula de Bhaskara es una fórmula matemática que se utiliza para resolver ecuaciones cuadráticas. En LaTeX, la fórmula se puede escribir de la siguiente manera:

```latex
\documentclass{article}
\usepackage{amsmath}

\begin{document}

La fórmula de Bhaskara para resolver una ecuación cuadrática de la forma \( ax^2 + bx + c = 0 \) es:

\[ x = \frac{-b \pm \sqrt{b^2 - 4ac}}{2a} \]

\end{document}
```

En este código LaTeX, se utiliza el paquete `amsmath` para mejorar la presentación de fórmulas matemáticas. La fórmula de Bhaskara se muestra en la parte superior del documento.

 Claro, en Java, una "if" es una estructura de control que permite tomar decisiones basadas en la evaluación de una condición. La estructura general de una "if" en Java es la siguiente:

```java
if (condición) {
    // Código a ejecutar si la condición es verdadera
}
```

La condición que se evalúa dentro del paréntesis debe ser un valor booleano, es decir, solo puede ser verdadero (`true`) o falso (`false`). Si la condición es verdadera, entonces el código dentro del bloque `{}` será ejecutado. Si la condición es falsa, el código dentro del bloque no será ejecutado.

Aquí hay un ejemplo más detallado:

```java
int numero = 10;

if (numero > 5) {
    System.out.println("El número es mayor que 5");
}
```

En este ejemplo, primero se declara una variable `numero` con el valor 10. Luego, se ejecuta la condición `numero > 5`. Dado que `numero` es mayor que 5, la condición es verdadera y se ejecuta el código dentro del bloque `{}`. Por lo tanto, se imprime el mensaje "El número es mayor que 5" en la consola.

También puedes anidar "if" dentro de "if" para manejar múltiples condiciones. Aquí hay un ejemplo:

```java
int numero = 10;

if (numero > 5) {
    System.out.println("El número es mayor que 5");
} else {
    if (numero > 10) {
        System.out.println("El número es mayor que 10");
    } else {
        System.out.println("El número es menor o igual que 10");
    }
}
```

En este ejemplo, primero se evalúa la condición `numero > 5`. Dado que `numero` es mayor que 5, se ejecuta el primer mensaje. Luego, se evalúa la condición `numero > 10`. Dado que `numero` no es mayor que 10, se ejecuta el tercer mensaje.

 Your code is almost correct, but there is a small mistake in the `checkPrime` function. You are using `numbers[i]` in the `console.log(numbers[i]);` statement, but you should be using `numbers[i]` in the `isPrime(numbers[i])` function call.

Here is the corrected code:

```javascript
function checkPrime(numbers) {
    for (let i = 0; i < numbers.length; i++) {
        if (isPrime(numbers[i])) {
            console.log(numbers[i]);
        }
    }
}

function isPrime(num) {
    if (num <= 1) return false;
    if (num === 2) return true;
    if (num % 2 === 0) return false;
    let sqrt = Math.sqrt(num);
    for (let i = 3; i <= sqrt; i += 2) {
        if (num % i === 0) return false;
    }
    return true;
}

// Example usage:
let numbers = [1, 2, 3, 4, 5];
checkPrime(numbers);
```

This will correctly print the prime numbers from the array to the console.

 Un bucle `for` en Java es una estructura de control que permite ejecutar un conjunto de instrucciones repetidamente hasta que se cumpla una condición determinada. La sintaxis básica de un bucle `for` en Java es la siguiente:

```java
for (inicialización; condición; incremento) {
    // Código a ejecutar en cada iteración
}
```

La sintaxis se desglosa de la siguiente manera:

1. **Inicialización**: Se ejecuta una vez al inicio del bucle, antes de la condición. Aquí es donde se inicializa cualquier variable que necesites y se puede realizar la primera iteración del bucle.

2. **Condición**: Se evalúa antes de cada iteración. Si la condición es verdadera, se ejecuta el bloque de código dentro del bucle. Si la condición es falsa, se sale del bucle.

3. **Incremento**: Se ejecuta después de cada iteración del bucle. A menudo se utiliza para modificar la variable de control del bucle, lo que generalmente conduce a que la condición se vuelva falsa y el bucle termine.

Veamos un ejemplo de bucle `for` que imprime los números del 1 al 10:

```java
for (int i = 1; i <= 10; i++) {
    System.out.println(i);
}
```

En este ejemplo, la variable `i` se inicializa con el valor 1, luego se verifica si `i` es menor o igual a 10. Si lo es, se ejecuta el bloque de código que imprime el valor de `i` y luego `i` se incrementa en 1. Este proceso se repite hasta que `i` es mayor a 10, lo que hace que la condición sea falsa y el bucle termine.
